d-images when set in the inline style attribute of a div.</li>\n<li>Images: updated to lazysizes 5.1.2 (5.2 is in beta now, might be integrated in AO26 if released in time).</li>\n<li>CSS/ JS: no longer add type attributes to Autoptimized resources.</li>\n<li>Improvement: cache clearing now also integrates with Kinsta, WP-Optimize &amp; Nginx helper.</li>\n<li>Added &#8220;Critical CSS&#8221; tab to highlight the criticalcss.com integration, which will be fully included in Autoptimize 2.7.</li>\n<li>Large batch of misc. smaller improvements &amp; fixes, more info in the [GitHub commit log](https://github.com/futtta/autoptimize/commits/beta).</li>\n</ul>\n<p>So in order to make this the smoothest release possible I would like <a href="https://github.com/futtta/autoptimize/archive/beta.zip">the beta to be downloaded</a> and tested by as many people as possible, including you!</p>\n<p>Any issue/ question/ bug can be reported here as a reply or if a bug and if you&#8217;re more technically inclined over at <a href="https://github.com/futtta/autoptimize/issues">Github as an issue</a>. Looking forward to your feedback!</p>\n<div class=\'yarpp-related-rss\'>\n<p>Possibly related twitterless twaddle:<ul>\n<li><a href="https://blog.futtta.be/2016/07/24/preparing-for-autoptimize-2-0-3-or-2-1-0/" rel="bookmark" title="Preparing (for) Autoptimize 2.0.3 or 2.1.0">Preparing (for) Autoptimize 2.0.3 or 2.1.0 </a></li>\n<li><a href="https://blog.futtta.be/2017/04/11/autoptimize-2-2-coming-your-way-care-to-test/" rel="bookmark" title="Autoptimize 2.2 coming your way, care to test?">Autoptimize 2.2 coming your way, care to test? </a></li>\n<li><a href="https://blog.futtta.be/2015/12/09/bringing-autoptimize-2-0-beta-to-a-christmas-tree-near-you/" rel="bookmark" title="Bringing Autoptimize 2.0 (beta) to a Christmas-tree near you">Bringing Autoptimize 2.0 (beta) to a Christmas-tree near you </a></li>\n</ul></p>\n</div>\n<img src="http://feeds.feedburner.com/~r/futtta_autoptimize/~4/aaqRJ_Xd0Ks" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:88:"https://blog.futtta.be/2019/11/20/autoptimize-2-6-almost-ready-beta-testers-needed/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:83:"https://blog.futtta.be/2019/11/20/autoptimize-2-6-almost-ready-beta-testers-needed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:85:"\n		\n		\n				\n				\n		\n				\n		\n		\n		\n		\n		\n		\n		\n		\n\n		\n				\n								\n							\n		\n							";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:40:"Autoptimize closing in on W3 Total Cache";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:65:"http://feedproxy.google.com/~r/futtta_autoptimize/~3/Z8LBbKqDVUk/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:84:"https://blog.futtta.be/2019/10/31/autoptimize-closing-in-on-w3-total-cache/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 31 Oct 2019 21:18:44 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:9:{i:0;a:5:{s:4:"data";s:11:"autoptimize";s:7