ver the last couple of months Juanfran Granados from Mirai, an hotelier agency that used WordPress extensively, worked hard to add multisite administration capabilities to Autoptimize: If AO has been network-activated, there will be an entry-point in the network settings screens where one can configure Autoptimize for the entire network. On the subsites the AO [...]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"frank";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2894:"<p><a href="http://blog.futtta.be/wp-content/uploads/2019/09/Selection_446.jpg"><img class="size-medium wp-image-10918 alignright" src="http://blog.futtta.be/wp-content/uploads/2019/09/Selection_446-300x220.jpg" alt="" width="300" height="220" srcset="http://blog.futtta.be/wp-content/uploads/2019/09/Selection_446-300x220.jpg 300w, http://blog.futtta.be/wp-content/uploads/2019/09/Selection_446-624x457.jpg 624w, http://blog.futtta.be/wp-content/uploads/2019/09/Selection_446.jpg 825w" sizes="(max-width: 300px) 100vw, 300px" /></a>Over the last couple of months <strong>Juanfran Granados</strong> from <a href="https://www.mirai.com/" target="_blank" rel="nofollow noopener noreferrer" data-saferedirecturl="https://www.google.com/url?q=https://www.mirai.com/&amp;source=gmail&amp;ust=1569139625034000&amp;usg=AFQjCNFmYCmkcmJLnpp85c5mMX78VD89vA">Mirai</a>, an hotelier agency that used WordPress extensively, worked hard to add multisite administration capabilities to Autoptimize:</p>\n<ul>\n<li>If AO has been network-activated, there will be an entry-point in the network settings screens where one can configure Autoptimize for the entire network.</li>\n<li>On the subsites the AO settings screen will show a message that settings are done at a network level</li>\n<li>On the network-AO-settings there is an option to allow AO to be configured per site</li>\n<li>if AO has not been network-activated, things work as they do now; all settings are done on a per-site level</li>\n</ul>\n<p>I have just <a href="https://github.com/futtta/autoptimize/tree/multisite-test">merged his code into separate branch on Github</a> and given that significant changes that went into this (almost all files changed), I need you and you and you and &#8230; to <a href="https://github.com/futtta/autoptimize/archive/multisite-test.zip">download and test that multisite-test branch</a> before I merge the changes into the beta branch. Looking forward to your feedback!</p>\n<div class=\'yarpp-related-rss\'>\n<p>Possibly related twitterless twaddle:<ul>\n<li><a href="https://blog.futtta.be/2015/10/27/autoptimize-to-allow-optimizing-whitelisted-resources-only-and-more/" rel="bookmark" title="Autoptimize to allow optimizing whitelisted resources only (and more)">Autoptimize to allow optimizing whitelisted resources only (and more) </a></li>\n<li><a href="https://blog.futtta.be/2015/12/09/bringing-autoptimize-2-0-beta-to-a-christmas-tree-near-you/" rel="bookmark" title="Bringing Autoptimize 2.0 (beta) to a Christmas-tree near you">Bringing Autoptimize 2.0 (beta) to a Christmas-tree near you </a></li>\n<li><a href="https://blog.futtta.be/2016/02/29/heads-up-autoptimize-minor-release/" rel="bookmark" title="Heads up: Autoptimize minor release">Heads up: Autoptimize minor release </a></li>\n</ul></p>\n</div>\n<img src="http://feeds.feedburner.com/~r/futtta_autoptimize/~4/nMOqydk9EIg" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:84:"https://blog.futtta.be/2019/09/21/autoptimize-2-6-testers-for-multisite-wanted/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"x