anks to the people who actively contributed and especially-especially to Emilio Lpez (Turl) for creating Autoptimize and <a href="https://blog.futtta.be/2013/01/07/adopting-an-oss-orphan-autoptimize/">handing it over to me back in 2013</a> and to <a href="https://twitter.com/zytzagoo">Toma Trkulja</a> who cleaned up al lot of the messy code I added to it and introducing me to PHP codesniffer &amp; Travis CI tests.</p>\n<div class=\'yarpp-related-rss\'>\n<p>Possibly related twitterless twaddle:<ul>\n<li><a href="https://blog.futtta.be/2016/03/15/why-would-you-still-be-on-php-5-2/" rel="bookmark" title="Why would you still be on PHP 5.2?">Why would you still be on PHP 5.2? </a></li>\n<li><a href="https://blog.futtta.be/2019/03/18/developers-dont-make-gutenberg-go-badass-enberg-on-my-frontend/" rel="bookmark" title="Developers: don&#8217;t make Gutenberg go Badass-enberg on my frontend!">Developers: don&#8217;t make Gutenberg go Badass-enberg on my frontend! </a></li>\n<li><a href="https://blog.futtta.be/2012/11/06/dipping-below-the-magical-1-second-page-load-time/" rel="bookmark" title="Dipping below the magical 1 second page load time">Dipping below the magical 1 second page load time </a></li>\n</ul></p>\n</div>\n<img src="http://feeds.feedburner.com/~r/futtta_autoptimize/~4/WkCDsnPTu3Q" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:63:"https://blog.futtta.be/2019/05/25/we-just-joined-the-club/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"6";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:58:"https://b