ts. Images: support for lazyloading of background-images [...]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"frank";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2237:"<div class="bbp-topic-content">\n<p>I just released AO26, which comes with a bunch of new features, improvements and bugfixes.</p>\n<ul>\n<li>New: Autoptimize can be configured at network level or at individual site-level when on multisite.</li>\n<li>Extra: new option to specify what resources need to be preloaded.</li>\n<li>Extra: add display=swap to Autoptimized (CSS-based) Google Fonts.</li>\n<li>Images: support for lazyloading of background-images when set in the inline style attribute of a div.</li>\n<li>Images: updated to lazysizes 5.2.</li>\n<li>CSS/ JS: no longer add type attributes to Autoptimized resources.</li>\n<li>Improvement: cache clearing now also integrates with Kinsta, WP-Optimize &amp; Nginx helper.</li>\n<li>Added Critical CSS tab to highlight the criticalcss.com integration, which will be fully included in Autoptimize 2.7.</li>\n<li>Batch of misc. smaller improvements &amp; fixes, more info in the GitHub commit log.</li>\n</ul>\n<p>The release has been tested extensively (automated unit testing, manual testing on several of my own sites and testing by users of the beta-version on Github), but as with all software it is very unlikely to be bug-free. Feel free to post any issue with the update here or to create a separate topic in this forum.</p>\n<p>Happy holidays to all!<br />\nfrank</p>\n</div>\n<div class=\'yarpp-related-rss\'>\n<p>Possibly related twitterless twaddle:<ul>\n<li><a href="https://blog.futtta.be/2014/04/17/some-html-dom-parsing-gotchas-in-phps-domdocument/" rel="bookmark" title="Some HTML DOM parsing gotchas in PHP&#8217;s DOMDocument">Some HTML DOM parsing gotchas in PHP&#8217;s DOMDocument </a></li>\n<li><a href="https://blog.futtta.be/2017/08/11/loading-webfonts-just-for-a-title-switch-to-svg-instead/" rel="bookmark" title="Loading webfonts just for a title? Switch to SVG instead.">Loading webfonts just for a title? Switch to SVG instead. </a></li>\n<li><a href="https://blog.futtta.be/2017/11/29/another-autoptimize-experiment-extras/" rel="bookmark" title="Another Autoptimize Experiment; Extra&#8217;s">Another Autoptimize Experiment; Extra&#8217;s </a></li>\n</ul></p>\n</div>\n<img src="http://feeds.feedburner.com/~r/futtta_wordpress/~4/Wt72p8vvEkE" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:64:"https://blog.futtta.be/2019/12/26/autoptimize-2-6-released/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"4";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:59:"https://blog.futtta.be/2019/12/26/autoptimize-2-6-released/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:85:"\n		\n		\n				\n				\n		\n				\n		\n		\n		\n		\n		\n		\n		\n		\n\n		\n				\n								\n							\n		\n							";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:36:"Autoptimize assets: 404-s nevermore?";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:63:"http