uploads/2019/05/Selection_323-300x177.jpg" alt="" width="300" height="177" srcset="http://blog.futtta.be/wp-content/uploads/2019/05/Selection_323-300x177.jpg 300w, http://blog.futtta.be/wp-content/uploads/2019/05/Selection_323-624x368.jpg 624w, http://blog.futtta.be/wp-content/uploads/2019/05/Selection_323.jpg 643w" sizes="(max-width: 300px) 100vw, 300px" /></a></p>\n<p>I&#8217;m very happy, thanks everyone for using, thanks for the support-questions &amp; all the great feedback therein and especially thanks to the people who actively contributed and especially-especially to Emilio Lpez (Turl) for creating Autoptimize and <a href="https://blog.futtta.be/2013/01/07/adopting-an-oss-orphan-autoptimize/">handing it over to me back in 2013</a> and to <a href="https://twitter.com/zytzagoo">Toma Trkulja</a> who cleaned up al lot of the messy code I added to it and introducing me to PHP codesniffer &amp; Travis CI tests.</p>\n<div class=\'yarpp-related-rss\'>\n<p>Possibly related twitterless twaddle:<ul>\n<li><a href="https://blog.futtta.be/2016/03/15/why-would-you-still-be-on-php-5-2/" rel="bookmark" title="Why would you still be on PHP 5.2?">Why would you still be on PHP 5.2? </a></li>\n<li><a href="https://blog.futtta.be/2019/03/18/developers-dont-make-gutenberg-go-badass-enberg-on-my-frontend/" rel="bookmark" title="Developers: don&#8217;t make Gutenberg go Badass-enberg on my frontend!">Developers: don&#8217;t make Gutenberg go Badass-enberg on my frontend! </a></li>\n<li><a href="https://blog.futtta.be/2012/11/06/dipping-below-the-magical-1-second-page-load-time/" rel="bookmark" title="Dipping below the magical 1 second page load time">Dipping below the magical 1 second page load time </a></li>\n</ul></p>\n</div>\n<img src="http://feeds.feedburner.com/~r/futtta_wordpress/~4/WkCDsnPTu3Q" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"co