INSERT INTO `wp_postmeta` VALUES (2677,1146,'what_we_do_content','Look What the Cat Brought In exists to care for cats that require longer shelter stays than a traditional shelter can provide, securing adoption when each cat is healthy and emotionally ready. We were founded in 2008 as the first shelter in Colorado Springs serving cats exclusively. We are proud to be a limited admission, adoption guaranteed shelter.\r\n<br>\r\n<strong>Our Cats</strong>\r\n\r\nWe accept cats from hoarding situations, Humane Society of Pikes Peak Region, Fort Carson Animal Rescue, Second Chance Animal Rescue Foundation, and other Colorado and Midwestern rescues. We keep our cats in a mix of colony housing and kenneled areas. All our cats are tested for FIV/FeLV, vaccinated, treated for parasites, and spayed or neutered.\r\n<br>\r\nSee our adoptable cats \r\n<br>\r\n<strong>Our Success Stories</strong>\r\n\r\nWe adopt hundreds of cats annually, both from our shelter and through two local pet store venues. Our alumni have gone to homes as far away as China and South America.\r\n<br>\r\nSee our memorial page ');
