INSERT INTO `wp_postmeta` VALUES (4909,1224,'_elementor_data','[{"id":"480368c","elType":"section","settings":{"structure":"22"},"elements":[{"id":"d97f071","elType":"column","settings":{"_column_size":66,"_inline_size":60},"elements":[{"id":"75b62d4","elType":"widget","settings":{"image":{"url":"http:\\/\\/localhost\\/wp-content\\/uploads\\/2020\\/02\\/DSCN7657_458-225x300-1.jpg","id":1192}},"elements":[],"widgetType":"image"},{"id":"66fb0f3","elType":"widget","settings":{"image":{"url":"http:\\/\\/localhost\\/wp-content\\/uploads\\/2020\\/02\\/catio-def-new-500x108-1.jpg","id":1191}},"elements":[],"widgetType":"image"}],"isInner":false},{"id":"0e49dd3","elType":"column","settings":{"_column_size":33,"_inline_size":39.332},"elements":[{"id":"4c7c2c9","elType":"widget","settings":{"editor":"<p style=\\"text-align: center;\\"><strong>Story behind the catio:\\u00a0\\u00a0<\\/strong><\\/p><p>I, the designer\\/builder of the catio, am a Girl Scout who was looking for a Gold Award project.\\u00a0 I knew I wanted to do something to improve the lives of shelter animals.\\u00a0 After touring \\u201cLook What the Cat Brought In\\u201d and talking with Jennifer Nosler, executive director of the Feline Rescue Network, I saw the need for a better environment for the more feral cats.\\u00a0 These cats are used to being outdoors; then, for their health and safety, they are often captured and turned over to a rescue for care.\\u00a0 Unfortunately, this usually means these cats are then confined to a relatively small indoor area.\\u00a0 Jennifer and I agreed that we could make an outdoor living area\\u2013a \\u201ccatio\\u201d\\u2013so the cats could choose to experience the elements as they desired.<\\/p><p>You, too, can have a catio!\\u00a0 Below are some design considerations, building materials that you would need, and construction details:<\\/p><header><\\/header><div>\\u00a0<\\/div>"},"elements":[],"widgetType":"text-editor"}],"isInner":false}],"isInner":false},{"id":"cc29668","elType":"section","settings":[],"elements":[{"id":"563c8fa","elType":"column","settings":{"_column_size":100,"_inline_size":null},"elements":[{"id":"9edc380","elType":"widget","settings":{"editor":"<header><p style=\\"text-align: center;\\"><strong>Catio Design Considerations:<\\/strong><\\/p><\\/header><div><p>Catio Design Considerations<\\/p><p>We chose to build the catio on an existing deck, covering a couple windows that could provide the cats access to both the indoors and the outdoors.\\u00a0 Though the deck limited the maximum size of the catio, we felt the freedom of choice option (i.e., the cats can go in or out whenever they wanted) made this the most desirable location.<\\/p><p>As is evident by the photo, I did have room to make the catio a bit larger; there are two reasons for the chosen size.\\u00a0 For one, since the deck is not on ground level, I needed to leave a walk space to allow access to the catio on all sides for any needed repairs, etc.\\u00a0 Secondly, I sized the catio to maximize use of standard size lumber to minimize costs.<\\/p><p>Because I placed the catio against a building, mine is only 3-sided.\\u00a0 The long wall is approximately 12 feet while the sides are 6 feet.\\u00a0 Though cats would have access via the windows, I still needed to provide door access for humans.<\\/p><p>When we received the building permit from the Colorado Department of Agriculture, I received the requirement that the enclosure be a double-enclosure with a one-foot space between the walls.<\\/p><p>Your catio may be different than mine.\\u00a0 Yours may be bigger or smaller.\\u00a0 You may place yours on a deck or on ground level.\\u00a0 Yours may be against a building or it may not be.\\u00a0 You can make a catio to fit your own space and needs!<\\/p><\\/div>"},"elements":[],"widgetType":"text-editor"}],"isInner":false}],"isInner":false},{"id":"d0a480a","elType":"section","settings":{"structure":"20"},"elements":[{"id":"c350321","elType":"column","settings":{"_column_size":50,"_inline_size":null},"elements":[{"id":"21fff57","elType":"widget","settings":{"editor":"<header><p><strong>Catio Building Materials:<\\/strong><\\/p><\\/header><div><p>If your catio will be different from mine, you will need different materials, of course.\\u00a0 Below is the list of materials and tools I needed to build mine:<\\/p><p dir=\\"ltr\\" style=\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\\"><span style=\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\">4 \\u2013 2x12x12 boards<\\/span><\\/p><p dir=\\"ltr\\" style=\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\\"><span style=\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\">16 \\u2013 2x12x8 boards<\\/span><\\/p><p dir=\\"ltr\\" style=\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\\"><span style=\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\">16 \\u2013 2x4x8 boards<\\/span><\\/p><p dir=\\"ltr\\" style=\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\\"><span style=\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\">8 \\u2013 roof panels<\\/span><\\/p><p dir=\\"ltr\\" style=\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\\"><span style=\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\">3 \\u2013 4\\u2032 x 50\\u2032 rolls chain link fencing<\\/span><\\/p><p dir=\\"ltr\\" style=\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\\"><span style=\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\">1 \\u2013 1 lb box 3\\u2033 nails<\\/span><\\/p><p dir=\\"ltr\\" style=\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\\"><span style=\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\">1 \\u2013 1 lb box 2.5\\u2033 screws<\\/span><\\/p><p dir=\\"ltr\\" style=\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\\"><span style=\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\">2 \\u2013 1 lb box 1.25\\u2033 screws<\\/span><\\/p><p dir=\\"ltr\\" style=\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\\"><span style=\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\">3 \\u2013 1 lb box 1.25\\u2033 staples<\\/span><\\/p><p dir=\\"ltr\\" style=\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\\"><span style=\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\">1 \\u2013 1 lb box 3\\/4\\u2033 staples<\\/span><\\/p><p dir=\\"ltr\\" style=\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\\"><span style=\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\">1 \\u2013 package of washers<\\/span><\\/p><p dir=\\"ltr\\" style=\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\\"><span style=\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\">10 \\u2013 3 x 7 tie plates<\\/span><\\/p><p dir=\\"ltr\\" style=\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\\"><span style=\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\">2 \\u2013 gate hinge\\/latch\\/pull sets<\\/span><\\/p><p dir=\\"ltr\\" style=\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\\"><span style=\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\">2 \\u2013 gallons weatherproofing stain<\\/span><\\/p><p dir=\\"ltr\\" style=\\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;\\"><span style=\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\">rollers for staining<\\/span><\\/p><\\/div>"},"elements":[],"widgetType":"text-editor"}],"isInner":false},{"id":"5caada9","elType":"column","settings":{"_column_size":50,"_inline_size":null},"elements":[{"id":"7b9c0c0","elType":"widget","settings":{"editor":"<p>\\u00a0<\\/p><p>Tools needed:<\\/p><ul><li>Saws to cut wood\\u2013we used a mitre saw and a jig saw<\\/li><li>Nail gun<\\/li><li>Hammer for staples<\\/li><li>Metal cutter for chain link<\\/li><li>Tape measure<\\/li><\\/ul><p>Materials notes:<\\/p><ul><li>I chose to use standard pine for the lumber in order to keep costs lower.\\u00a0 I learned that the quality of standard pine varies so went to two different stores in order to select the best boards\\u2013minimal warping or cracks.<\\/li><li>Because the structure will be exposed to weather, I protected the wood with a transparent weather-proofing stain (transparent is cheaper than the semi-transparent or solid color options).<\\/li><li>I chose white panels for the roof to minimize heat absorption while still allowing some light to filter through.<\\/li><\\/ul>"},"elements":[],"widgetType":"text-editor"}],"isInner":false}],"isInner":false},{"id":"ce038d2","elType":"section","settings":{"structure":"21"},"elements":[{"id":"b1bfd80","elType":"column","settings":{"_column_size":33,"_inline_size":null},"elements":[{"id":"4b1ae7a","elType":"widget","settings":{"image":{"url":"http:\\/\\/localhost\\/wp-content\\/uploads\\/2020\\/02\\/1.jpg","id":1193},"image_size":"custom","image_custom_dimension":{"width":"","height":"130"}},"elements":[],"widgetType":"image"},{"id":"9b2d7a8","elType":"widget","settings":{"image":{"url":"http:\\/\\/localhost\\/wp-content\\/uploads\\/2020\\/02\\/2.jpg","id":1194},"image_size":"custom","image_custom_dimension":{"width":"","height":"130"}},"elements":[],"widgetType":"image"},{"id":"2048955","elType":"widget","settings":{"image":{"url":"http:\\/\\/localhost\\/wp-content\\/uploads\\/2020\\/02\\/3.jpg","id":1195},"image_size":"custom","image_custom_dimension":{"width":"","height":"130"}},"elements":[],"widgetType":"image"},{"id":"8f1aadb","elType":"widget","settings":{"image":{"url":"http:\\/\\/localhost\\/wp-content\\/uploads\\/2020\\/02\\/4.jpg","id":1196},"image_size":"custom","image_custom_dimension":{"width":"","height":"130"}},"elements":[],"widgetType":"image"},{"id":"ce4ed5b","elType":"widget","settings":{"image":{"url":"http:\\/\\/localhost\\/wp-content\\/uploads\\/2020\\/02\\/5.jpg","id":1197},"image_size":"custom","image_custom_dimension":{"width":"","height":"130"}},"elements":[],"widgetType":"image"},{"id":"3269ff1","elType":"widget","settings":{"image":{"url":"http:\\/\\/localhost\\/wp-content\\/uploads\\/2020\\/02\\/7.jpg","id":1199},"image_size":"custom","image_custom_dimension":{"width":"","height":"130"}},"elements":[],"widgetType":"image"},{"id":"2b79664","elType":"widget","settings":{"image":{"url":"http:\\/\\/localhost\\/wp-content\\/uploads\\/2020\\/02\\/6.jpg","id":1198},"image_size":"custom","image_custom_dimension":{"width":"","height":"130"}},"elements":[],"widgetType":"image"},{"id":"83fd1d3","elType":"widget","settings":{"image":{"url":"http:\\/\\/localhost\\/wp-content\\/uploads\\/2020\\/02\\/7-2.jpg","id":1200},"image_size":"custom","image_custom_dimension":{"width":"","height":"130"}},"elements":[],"widgetType":"image"},{"id":"d50bbc8","elType":"widget","settings":{"image":{"url":"http:\\/\\/localhost\\/wp-content\\/uploads\\/2020\\/02\\/8-2.jpg","id":1202},"image_size":"custom","image_custom_dimension":{"width":"","height":"130"}},"elements":[],"widgetType":"image"},{"id":"b51269c","elType":"widget","settings":{"image":{"url":"http:\\/\\/localhost\\/wp-content\\/uploads\\/2020\\/02\\/8.jpg","id":1201},"image_size":"custom","image_custom_dimension":{"width":"","height":"130"}},"elements":[],"widgetType":"image"}],"isInner":false},{"id":"9e857fc","elType":"column","settings":{"_column_size":66,"_inline_size":null},"elements":[{"id":"92fa957","elType":"widget","settings":{"editor":"<header class=\\"entry-header\\"><ol><li class=\\"entry-title\\"><strong>Catio Construction How-To:<\\/strong><\\/li><\\/ol><\\/header><div class=\\"entry-content\\"><p>The instructions below give the general overview of how I built catio:<\\/p><p>Board preparation<\\/p><ol><li>Cut 4 2x12x8 boards down to 6\\u2032 to make top and bottom of the side walls.\\u00a0 (note: save the 2\\u2032 boards\\u2013you\\u2019ll need them later for the door frame)<\\/li><li>With a jig saw, cut notches in 2 2x12x12 boards to enable the roof to slope.\\u00a0 One board has a 3.5\\u2033 notch on either end; the other has a 2.5\\u2033 notch on either end.<\\/li><li>Stain all wood.\\u00a0 We applied two coats to all sides.\\u00a0 Let dry thoroughly.<\\/li><\\/ol><p>Constructing the outside of the enclosure<\\/p><ol><li>Build first side wall frame using 2 2x12x6 boards (2 of the 2x12x8 boards that were cut down to 6\\u2032) for the horizontal top and bottom and 3 2x12x8 lengths for the vertical supports.\\u00a0 Attach boards using 3\\u2033 nails.<\\/li><li>For stability, we attached a 2x4x8 diagonally across the side wall by cutting notches into two of the 2x12x8 boards and one of the 2x12x6 boards to lock in the 2x4x8.\\u00a0 It is critical to make sure the wall frame is straight before cutting notches.\\u00a0 Once the\\u00a02x4x8 is locked in, the ends can be trimmed flush with the side walls.\\u00a0 (note:\\u00a0 the side on which the 2x4x8 is placed will be the outside)<\\/li><li>Cut two 8\\u20193\\u2033 lengths of chain link.\\u00a0 (note:\\u00a0 the additional 3\\u2033 allows the chain link to be attached to the top and bottom boards).\\u00a0 Attach the chain link using 1.25\\u2033 staples to what will be the outside of the enclosure.<\\/li><li>Build the long wall frame using 2\\u00a02x12x12 boards for the horizontal top and bottom and 6\\u00a02x12x8 lengths for the vertical supports.\\u00a0 The vertical supports should be placed to create 5 sections:\\u00a0 a 4\\u2032 section in the middle, 3\\u2032 sections on either side, and then 1\\u2032 sections on the ends which will match up with the side walls.\\u00a0 Again, nail boards together using 3\\u2033 nails, attach\\u00a02x4x8 boards for stability, and attach chain link.<\\/li><li>Stand up the two completed sections and screw together using the 2.5\\u2033 screws.<\\/li><li>Create the final side wall very much like the first one.\\u00a0 Only difference is that the\\u00a02x4x8 only goes thru the one section and chain link only covers one section; the other section will be for the doors.<\\/li><li>For stability on the door section, use 3 of the 4 to build a double horizontal support 3\\u2032 in length.\\u00a0 Attach the support using 3\\u2033 nails so that their doorway is 7\\u2032 high.<\\/li><li>Attach this last section to the main wall using screws as before.<\\/li><\\/ol><p>Constructing the roof<\\/p><ol><li>The notched 2x12x12 boards will be used to support the roof.\\u00a0 To support these boards, attach\\u00a02x4x8 boards to the wall frames on either end.\\u00a0 (note:\\u00a0 the\\u00a02x4x8 boards will need to be cut to fit.\\u00a0 We did this on site to get the most exact fit.)\\u00a0 The deepest notch board went along the building; the other notched board went down the middle.<\\/li><li>At this point, all wood is in place.\\u00a0 Since this catio was built on a deck, we then screwed it down to the deck for added stability.<\\/li><li>Attach roof panels using 1.25\\u2033 screws and washers.<\\/li><\\/ol><p>Constructing the interior &amp; doors<\\/p><ol><li>Attach chain link sections to the interior of the enclosure.\\u00a0 We used the 3\\/4\\u2033 staples except where the chain link overlapped; in those cases, we needed the larger 1.25\\u2033 staples.<\\/li><li>Build two doors using 4\\u00a02x4x8 boards for each:\\u00a0 2 are for the vertical edges, 1 is cut into thirds to create horizontal beams, and the last is a supporting diagonal.\\u00a0 Attach the door hinges and latch and then 5 tie plates per door for support as needed.<\\/li><li>Attach the doors to the doorway<\\/li><li>Add cat things and cats!<\\/li><\\/ol><\\/div>"},"elements":[],"widgetType":"text-editor"}],"isInner":false}],"isInner":false}]');
