INSERT INTO `wp_posts` VALUES (1224,1,'2020-02-06 15:22:40','2020-02-06 22:22:40','<img width="225" height="300" src="http://localhost/wp-content/uploads/2020/02/DSCN7657_458-225x300-1.jpg" alt="" />											\n										<img width="500" height="108" src="http://localhost/wp-content/uploads/2020/02/catio-def-new-500x108-1.jpg" alt="" srcset="http://localhost/wp-content/uploads/2020/02/catio-def-new-500x108-1.jpg 500w, http://localhost/wp-content/uploads/2020/02/catio-def-new-500x108-1-300x65.jpg 300w" sizes="(max-width: 500px) 100vw, 500px" />											\n		<p style="text-align: center;"><strong>Story behind the catio:</strong></p><p>I, the designer/builder of the catio, am a Girl Scout who was looking for a Gold Award project. I knew I wanted to do something to improve the lives of shelter animals. After touring Look What the Cat Brought In and talking with Jennifer Nosler, executive director of the Feline Rescue Network, I saw the need for a better environment for the more feral cats. These cats are used to being outdoors; then, for their health and safety, they are often captured and turned over to a rescue for care. Unfortunately, this usually means these cats are then confined to a relatively small indoor area. Jennifer and I agreed that we could make an outdoor living areaa catioso the cats could choose to experience the elements as they desired.</p><p>You, too, can have a catio! Below are some design considerations, building materials that you would need, and construction details:</p><header></header><header><p style="text-align: center;"><strong>Catio Design Considerations:</strong></p></header><p>Catio Design Considerations</p><p>We chose to build the catio on an existing deck, covering a couple windows that could provide the cats access to both the indoors and the outdoors. Though the deck limited the maximum size of the catio, we felt the freedom of choice option (i.e., the cats can go in or out whenever they wanted) made this the most desirable location.</p><p>As is evident by the photo, I did have room to make the catio a bit larger; there are two reasons for the chosen size. For one, since the deck is not on ground level, I needed to leave a walk space to allow access to the catio on all sides for any needed repairs, etc. Secondly, I sized the catio to maximize use of standard size lumber to minimize costs.</p><p>Because I placed the catio against a building, mine is only 3-sided. The long wall is approximately 12 feet while the sides are 6 feet. Though cats would have access via the windows, I still needed to provide door access for humans.</p><p>When we received the building permit from the Colorado Department of Agriculture, I received the requirement that the enclosure be a double-enclosure with a one-foot space between the walls.</p><p>Your catio may be different than mine. Yours may be bigger or smaller. You may place yours on a deck or on ground level. Yours may be against a building or it may not be. You can make a catio to fit your own space and needs!</p><header><p><strong>Catio Building Materials:</strong></p></header><p>If your catio will be different from mine, you will need different materials, of course. Below is the list of materials and tools I needed to build mine:</p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">4  2x12x12 boards</p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">16  2x12x8 boards</p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">16  2x4x8 boards</p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">8  roof panels</p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">3  4 x 50 rolls chain link fencing</p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">1  1 lb box 3 nails</p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">1  1 lb box 2.5 screws</p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">2  1 lb box 1.25 screws</p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">3  1 lb box 1.25 staples</p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">1  1 lb box 3/4 staples</p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">1  package of washers</p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">10  3 x 7 tie plates</p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">2  gate hinge/latch/pull sets</p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">2  gallons weatherproofing stain</p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">rollers for staining</p><p></p><p>Tools needed:</p><ul><li>Saws to cut woodwe used a mitre saw and a jig saw</li><li>Nail gun</li><li>Hammer for staples</li><li>Metal cutter for chain link</li><li>Tape measure</li></ul><p>Materials notes:</p><ul><li>I chose to use standard pine for the lumber in order to keep costs lower. I learned that the quality of standard pine varies so went to two different stores in order to select the best boardsminimal warping or cracks.</li><li>Because the structure will be exposed to weather, I protected the wood with a transparent weather-proofing stain (transparent is cheaper than the semi-transparent or solid color options).</li><li>I chose white panels for the roof to minimize heat absorption while still allowing some light to filter through.</li></ul>		\n										<img src="http://localhost/wp-content/uploads/elementor/thumbs/1-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" title="1" alt="1" />											\n										<img src="http://localhost/wp-content/uploads/elementor/thumbs/2-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" title="2" alt="2" />											\n										<img src="http://localhost/wp-content/uploads/elementor/thumbs/3-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" title="3" alt="3" />											\n										<img src="http://localhost/wp-content/uploads/elementor/thumbs/4-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" title="4" alt="4" />											\n										<img src="http://localhost/wp-content/uploads/elementor/thumbs/5-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" title="5" alt="5" />											\n										<img src="http://localhost/wp-content/uploads/elementor/thumbs/7-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" title="7" alt="7" />											\n										<img src="http://localhost/wp-content/uploads/elementor/thumbs/6-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" title="6" alt="6" />											\n										<img src="http://localhost/wp-content/uploads/elementor/thumbs/7-2-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" title="7-2" alt="7-2" />											\n										<img src="http://localhost/wp-content/uploads/elementor/thumbs/8-2-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" title="8-2" alt="8-2" />											\n										<img src="http://localhost/wp-content/uploads/elementor/thumbs/8-oksc3vq42lj975umzzholzjrcfbpcs4wb89cc414ao.jpg" title="8" alt="8" />											\n		<header><ol><li><strong>Catio Construction How-To:</strong></li></ol></header><p>The instructions below give the general overview of how I built catio:</p><p>Board preparation</p><ol><li>Cut 4 2x12x8 boards down to 6 to make top and bottom of the side walls. (note: save the 2 boardsyoull need them later for the door frame)</li><li>With a jig saw, cut notches in 2 2x12x12 boards to enable the roof to slope. One board has a 3.5 notch on either end; the other has a 2.5 notch on either end.</li><li>Stain all wood. We applied two coats to all sides. Let dry thoroughly.</li></ol><p>Constructing the outside of the enclosure</p><ol><li>Build first side wall frame using 2 2x12x6 boards (2 of the 2x12x8 boards that were cut down to 6) for the horizontal top and bottom and 3 2x12x8 lengths for the vertical supports. Attach boards using 3 nails.</li><li>For stability, we attached a 2x4x8 diagonally across the side wall by cutting notches into two of the 2x12x8 boards and one of the 2x12x6 boards to lock in the 2x4x8. It is critical to make sure the wall frame is straight before cutting notches. Once the2x4x8 is locked in, the ends can be trimmed flush with the side walls. (note: the side on which the 2x4x8 is placed will be the outside)</li><li>Cut two 83 lengths of chain link. (note: the additional 3 allows the chain link to be attached to the top and bottom boards). Attach the chain link using 1.25 staples to what will be the outside of the enclosure.</li><li>Build the long wall frame using 22x12x12 boards for the horizontal top and bottom and 62x12x8 lengths for the vertical supports. The vertical supports should be placed to create 5 sections: a 4 section in the middle, 3 sections on either side, and then 1 sections on the ends which will match up with the side walls. Again, nail boards together using 3 nails, attach2x4x8 boards for stability, and attach chain link.</li><li>Stand up the two completed sections and screw together using the 2.5 screws.</li><li>Create the final side wall very much like the first one. Only difference is that the2x4x8 only goes thru the one section and chain link only covers one section; the other section will be for the doors.</li><li>For stability on the door section, use 3 of the 4 to build a double horizontal support 3 in length. Attach the support using 3 nails so that their doorway is 7 high.</li><li>Attach this last section to the main wall using screws as before.</li></ol><p>Constructing the roof</p><ol><li>The notched 2x12x12 boards will be used to support the roof. To support these boards, attach2x4x8 boards to the wall frames on either end. (note: the2x4x8 boards will need to be cut to fit. We did this on site to get the most exact fit.) The deepest notch board went along the building; the other notched board went down the middle.</li><li>At this point, all wood is in place. Since this catio was built on a deck, we then screwed it down to the deck for added stability.</li><li>Attach roof panels using 1.25 screws and washers.</li></ol><p>Constructing the interior &amp; doors</p><ol><li>Attach chain link sections to the interior of the enclosure. We used the 3/4 staples except where the chain link overlapped; in those cases, we needed the larger 1.25 staples.</li><li>Build two doors using 42x4x8 boards for each: 2 are for the vertical edges, 1 is cut into thirds to create horizontal beams, and the last is a supporting diagonal. Attach the door hinges and latch and then 5 tie plates per door for support as needed.</li><li>Attach the doors to the doorway</li><li>Add cat things and cats!</li></ol>','The Catio','','inherit','closed','closed','','1222-revision-v1','','','2020-02-06 15:22:40','2020-02-06 22:22:40','',1222,'http://localhost/1222-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (1225,1,'2020-02-06 15:23:08','2020-02-06 22:23:08','<img src="http://localhost/wp-content/uploads/2020/02/DSCN7657_458-225x300-1.jpg" alt="" width="225" height="300" />\r\n<img src="http://localhost/wp-content/uploads/2020/02/catio-def-new-500x108-1.jpg" sizes="(max-width: 500px) 100vw, 500px" srcset="http://localhost/wp-content/uploads/2020/02/catio-def-new-500x108-1.jpg 500w, http://localhost/wp-content/uploads/2020/02/catio-def-new-500x108-1-300x65.jpg 300w" alt="" width="500" height="108" />\r\n<p style="text-align: center;"><strong>Story behind the catio:</strong></p>\r\nI, the designer/builder of the catio, am a Girl Scout who was looking for a Gold Award project. I knew I wanted to do something to improve the lives of shelter animals. After touring Look What the Cat Brought In and talking with Jennifer Nosler, executive director of the Feline Rescue Network, I saw the need for a better environment for the more feral cats. These cats are used to being outdoors; then, for their health and safety, they are often captured and turned over to a rescue for care. Unfortunately, this usually means these cats are then confined to a relatively small indoor area. Jennifer and I agreed that we could make an outdoor living areaa catioso the cats could choose to experience the elements as they desired.\r\n\r\nYou, too, can have a catio! Below are some design considerations, building materials that you would need, and construction details:\r\n\r\n<header></header><header>\r\n<p style="text-align: center;"><strong>Catio Design Considerations:</strong></p>\r\n\r\n</header>Catio Design Considerations\r\n\r\nWe chose to build the catio on an existing deck, covering a couple windows that could provide the cats access to both the indoors and the outdoors. Though the deck limited the maximum size of the catio, we felt the freedom of choice option (i.e., the cats can go in or out whenever they wanted) made this the most desirable location.\r\n\r\nAs is evident by the photo, I did have room to make the catio a bit larger; there are two reasons for the chosen size. For one, since the deck is not on ground level, I needed to leave a walk space to allow access to the catio on all sides for any needed repairs, etc. Secondly, I sized the catio to maximize use of standard size lumber to minimize costs.\r\n\r\nBecause I placed the catio against a building, mine is only 3-sided. The long wall is approximately 12 feet while the sides are 6 feet. Though cats would have access via the windows, I still needed to provide door access for humans.\r\n\r\nWhen we received the building permit from the Colorado Department of Agriculture, I received the requirement that the enclosure be a double-enclosure with a one-foot space between the walls.\r\n\r\nYour catio may be different than mine. Yours may be bigger or smaller. You may place yours on a deck or on ground level. Yours may be against a building or it may not be. You can make a catio to fit your own space and needs!\r\n\r\n<header><strong>Catio Building Materials:</strong>\r\n\r\n</header>If your catio will be different from mine, you will need different materials, of course. Below is the list of materials and tools I needed to build mine:\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">4  2x12x12 boards</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">16  2x12x8 boards</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">16  2x4x8 boards</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">8  roof panels</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">3  4 x 50 rolls chain link fencing</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">1  1 lb box 3 nails</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">1  1 lb box 2.5 screws</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">2  1 lb box 1.25 screws</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">3  1 lb box 1.25 staples</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">1  1 lb box 3/4 staples</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">1  package of washers</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">10  3 x 7 tie plates</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">2  gate hinge/latch/pull sets</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">2  gallons weatherproofing stain</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;">rollers for staining</p>\r\nTools needed:\r\n<ul>\r\n 	<li>Saws to cut woodwe used a mitre saw and a jig saw</li>\r\n 	<li>Nail gun</li>\r\n 	<li>Hammer for staples</li>\r\n 	<li>Metal cutter for chain link</li>\r\n 	<li>Tape measure</li>\r\n</ul>\r\nMaterials notes:\r\n<ul>\r\n 	<li>I chose to use standard pine for the lumber in order to keep costs lower. I learned that the quality of standard pine varies so went to two different stores in order to select the best boardsminimal warping or cracks.</li>\r\n 	<li>Because the structure will be exposed to weather, I protected the wood with a transparent weather-proofing stain (transparent is cheaper than the semi-transparent or solid color options).</li>\r\n 	<li>I chose white panels for the roof to minimize heat absorption while still allowing some light to filter through.</li>\r\n</ul>\r\n<img title="1" src="http://localhost/wp-content/uploads/elementor/thumbs/1-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" alt="1" />\r\n<img title="2" src="http://localhost/wp-content/uploads/elementor/thumbs/2-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" alt="2" />\r\n<img title="3" src="http://localhost/wp-content/uploads/elementor/thumbs/3-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" alt="3" />\r\n<img title="4" src="http://localhost/wp-content/uploads/elementor/thumbs/4-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" alt="4" />\r\n<img title="5" src="http://localhost/wp-content/uploads/elementor/thumbs/5-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" alt="5" />\r\n<img title="7" src="http://localhost/wp-content/uploads/elementor/thumbs/7-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" alt="7" />\r\n<img title="6" src="http://localhost/wp-content/uploads/elementor/thumbs/6-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" alt="6" />\r\n<img title="7-2" src="http://localhost/wp-content/uploads/elementor/thumbs/7-2-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" alt="7-2" />\r\n<img title="8-2" src="http://localhost/wp-content/uploads/elementor/thumbs/8-2-oksc3us9vrhyvjw05h321hsar1gc5315z3luuu2igw.jpg" alt="8-2" />\r\n<img title="8" src="http://localhost/wp-content/uploads/elementor/thumbs/8-oksc3vq42lj975umzzholzjrcfbpcs4wb89cc414ao.jpg" alt="8" />\r\n\r\n<header>\r\n<ol>\r\n 	<li><strong>Catio Construction How-To:</strong></li>\r\n</ol>\r\n</header>The instructions below give the general overview of how I built catio:\r\n\r\nBoard preparation\r\n<ol>\r\n 	<li>Cut 4 2x12x8 boards down to 6 to make top and bottom of the side walls. (note: save the 2 boardsyoull need them later for the door frame)</li>\r\n 	<li>With a jig saw, cut notches in 2 2x12x12 boards to enable the roof to slope. One board has a 3.5 notch on either end; the other has a 2.5 notch on either end.</li>\r\n 	<li>Stain all wood. We applied two coats to all sides. Let dry thoroughly.</li>\r\n</ol>\r\nConstructing the outside of the enclosure\r\n<ol>\r\n 	<li>Build first side wall frame using 2 2x12x6 boards (2 of the 2x12x8 boards that were cut down to 6) for the horizontal top and bottom and 3 2x12x8 lengths for the vertical supports. Attach boards using 3 nails.</li>\r\n 	<li>For stability, we attached a 2x4x8 diagonally across the side wall by cutting notches into two of the 2x12x8 boards and one of the 2x12x6 boards to lock in the 2x4x8. It is critical to make sure the wall frame is straight before cutting notches. Once the2x4x8 is locked in, the ends can be trimmed flush with the side walls. (note: the side on which the 2x4x8 is placed will be the outside)</li>\r\n 	<li>Cut two 83 lengths of chain link. (note: the additional 3 allows the chain link to be attached to the top and bottom boards). Attach the chain link using 1.25 staples to what will be the outside of the enclosure.</li>\r\n 	<li>Build the long wall frame using 22x12x12 boards for the horizontal top and bottom and 62x12x8 lengths for the vertical supports. The vertical supports should be placed to create 5 sections: a 4 section in the middle, 3 sections on either side, and then 1 sections on the ends which will match up with the side walls. Again, nail boards together using 3 nails, attach2x4x8 boards for stability, and attach chain link.</li>\r\n 	<li>Stand up the two completed sections and screw together using the 2.5 screws.</li>\r\n 	<li>Create the final side wall very much like the first one. Only difference is that the2x4x8 only goes thru the one section and chain link only covers one section; the other section will be for the doors.</li>\r\n 	<li>For stability on the door section, use 3 of the 4 to build a double horizontal support 3 in length. Attach the support using 3 nails so that their doorway is 7 high.</li>\r\n 	<li>Attach this last section to the main wall using screws as before.</li>\r\n</ol>\r\nConstructing the roof\r\n<ol>\r\n 	<li>The notched 2x12x12 boards will be used to support the roof. To support these boards, attach2x4x8 boards to the wall frames on either end. (note: the2x4x8 boards will need to be cut to fit. We did this on site to get the most exact fit.) The deepest notch board went along the building; the other notched board went down the middle.</li>\r\n 	<li>At this point, all wood is in place. Since this catio was built on a deck, we then screwed it down to the deck for added stability.</li>\r\n 	<li>Attach roof panels using 1.25 screws and washers.</li>\r\n</ol>\r\nConstructing the interior &amp; doors\r\n<ol>\r\n 	<li>Attach chain link sections to the interior of the enclosure. We used the 3/4 staples except where the chain link overlapped; in those cases, we needed the larger 1.25 staples.</li>\r\n 	<li>Build two doors using 42x4x8 boards for each: 2 are for the vertical edges, 1 is cut into thirds to create horizontal beams, and the last is a supporting diagonal. Attach the door hinges and latch and then 5 tie plates per door for support as needed.</li>\r\n 	<li>Attach the doors to the doorway</li>\r\n 	<li>Add cat things and cats!</li>\r\n</ol>','The Catio','','inherit','closed','closed','','1222-revision-v1','','','2020-02-06 15:23:08','2020-02-06 22:23:08','',1222,'http://localhost/1222-revision-v1/',0,'revision','',0);
